import React, { Component, Fragment } from "react";
import formatDate from "./formatDate";
import { Link } from "react-router-dom";
import "../Usuario/userProfile.css";

class sobreEvento extends Component {
  componentWillMount() {
    const userId = localStorage.getItem("user_id");
    if (userId === null) {
      this.setState({ userLogged: false });
    } else {
      this.setState({ userLogged: true });
    }
  }
  state = {
    userLogged: false
  };

  getStyleButton = () => {
    const { userLogged } = this.state;
    return userLogged
      ? "btn blue lighten-1 right"
      : "disabled btn blue lighten-1 right";
  };

  getTextButton = () => {
    const { userLogged } = this.state;
    return userLogged ? "Inscrever-se" : "Efetue login";
  };

  formatValor = valor => {
    return valor === 0 ? "Gratuito" : `R$ ${valor}`;
  };

  getTime = time => {
    return time.substring(11, 16);
  };

  verifyDate = () => {
    let { dataFim } = this.props;
    let dataAtual = new Date();
    dataAtual.setHours(0, 0, 0, 0);
    dataFim = Date.parse(dataFim);
    return dataFim.valueOf() >= dataAtual.valueOf();
  };

  render() {
    const {
      nomeEvento,
      descricao,
      dataInicio,
      dataFim,
      idEvento,
      valoresEvento,
      inicioInscricoes,
      fimInscricoes
    } = this.props;
    return (
      <div className="container">
        <div className="card-panel z-depth-2">
          <div className="row">
            <div id="sobre" className="col s12">
              <br />
              <h3>{nomeEvento}</h3>
              <br />
              <h5>
                <i className="material-icons left">equalizer</i>Sobre o evento
              </h5>
              <p className="basicInfo grey-text text-darken-2">{descricao}</p>
              <br />
              <h5>
                <i className="material-icons left">info</i>Informações
                importantes
              </h5>
              <div className="basicInfo grey-text text-darken-2">
                <p>
                  <b>Inicio do evento:</b>
                  <span className="right">{formatDate(dataInicio)}</span>
                </p>
                <hr className="style-six" />
                <p>
                  <b>Término do evento:</b>
                  <span className="right">{formatDate(dataFim)}</span>
                </p>
                <hr className="style-six" />
                {inicioInscricoes ? (
                  <Fragment>
                    <p>
                      <b>Início inscrições:</b>
                      <span className="right">
                        {formatDate(inicioInscricoes)}
                      </span>
                    </p>
                    <hr className="style-six" />
                  </Fragment>
                ) : null}
                <hr className="style-six" />
                {fimInscricoes ? (
                  <Fragment>
                    <p>
                      <b>Término inscrições:</b>
                      <span className="right">{formatDate(fimInscricoes)}</span>
                    </p>
                    <hr className="style-six" />
                  </Fragment>
                ) : null}
                {valoresEvento.map((valor, i) => (
                  <Fragment>
                    <p key={i}>
                      <b>{valor.nome}</b>
                      <span className="right">
                        {this.formatValor(valor.preco)}
                      </span>
                    </p>
                    <hr className="style-six" />
                  </Fragment>
                ))}
              </div>
              <br />
              <Link to="/pet/eventos" className="btn blue lighten-1 left">
                Voltar
              </Link>
              {this.verifyDate() ? (
                <Link
                  to={`/pet/eventos/${idEvento}/cadastro`}
                  className={this.getStyleButton()}
                  style={{
                    textOverflow: "ellipsis",
                    whiteSpace: "nowrap",
                    overflow: "hidden"
                  }}
                >
                  {this.getTextButton()}
                </Link>
              ) : null}
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default sobreEvento;
